import './App.css';
import { useSelector, useDispatch } from 'react-redux';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; 

// import Login from './Components/Login/Login';
import { selectAuth, selectUsername, selectUserId } from './slices/userDetailsSlice';
import ProductList from './Components/Product/ViewProducts/ProductList';
import Login from './Components/Login/Login';
import AdminDashboard from './Components/AdminDashboard/AdminDashboard';
import Register from './Components/Register/Register';
import Header from './Components/Header/Header';
import React from 'react';
import NewProduct from './Components/Product/NewProduct/NewProduct';


function App() {
  const userDetail = {
    auth: useSelector(selectAuth),
    username: useSelector(selectUsername),
    userid: useSelector(selectUserId),
  };

  console.log(userDetail)

  return (
    <Router>
      <Switch>
      <React.Fragment>
        <Header/>
        <Route exact path="/login">
          <Login/>
        </Route>
        <Route exact path={["/register"]}>
          <Register/>
        </Route>
        <Route exact path={["/", "/baligya"]}>
          <ProductList/>
        </Route>
        <Route exact path={["/Test"]}>
          <NewProduct/>
        </Route>
      </React.Fragment>
      </Switch>
    </Router>
  );
}

export default App;
